Αλλά αυτή η επεξήγηση στην αφοσίωση παραλείπεται στην αξιολόγηση, αφήνοντας τον αναγνώστη να μην είναι πιο σοφός από πριν. Δικαιούμαστε να πούμε ότι "Η ανάλυση κάλυψε όλες τις πληροφορίες που μπορεί να χρειάζεται να γνωρίζει ένας αναγνώστης."; Ναι, όχι, ή ίσως;
Οχι

Από τώρα και στο εξής, η εθνική ενότητα παίζει πάντοτε το δεύτερο ρόλο στην εθνοτική, θρησκευτική και πάνω απ' όλα στα οικονομικά περιφερειακά συμφέροντα. Δικαιούμαστε να πούμε ότι "Η εθνική ενότητα δεν είναι ποτέ η πρώτη προταιρεότητα."; Ναι, όχι, ή ίσως;
Ναί

Όχι. Ο Blood έκλεισε το τηλεσκόπιό του. Δικαιούμαστε να πούμε ότι "Δεν υπήρχαν σημάδια αίματος πουθενά κοντά στο τηλεσκόπιο."; Ναι, όχι, ή ίσως;
Οχι

Λοιπόν, δεν το σκέφτηκα καν, αλλά ήμουν τόσο απογοητευμένος, και κατέληξα να του μιλάω και πάλι. Δικαιούμαστε να πούμε ότι "Δεν του μίλησα ξανά."; Ναι, όχι, ή ίσως;
